INSERT INTO `products` VALUES ('2', null, null, null, null, '45', '1', '1', '1', '1', 'Tủ bếp gỗ công nghiệp', '15661-9849', null, 'Tủ bếp gỗ công nghiệp cao cấp Ngày nay ngoài chất liệu gỗ tự nhiên xoan đào, gỗ sồi nga, gỗ thông... làm tủ bếp nói riêng và đồ nội thất nói chung, khách hàng có thêm được sự lựa chọn là gỗ công nghiệp cao cấp như lamilate,acylic, meca... Với kiểu dáng cách tân phù hợp với những không gian nhà hiện đại, gỗ công nghiệp cao cấp đang ngày càng chiếm được lòng tin của người tiêu dùng, đặc biệt với những đôi vợ chồng trẻ. Cùng với sự phát triển của khoa học kỹ thuật, chất lượng của gỗ công nghiệp đang ngày càng được nâng cao hơn để không thua kém so với gỗ tự nhiên. Hiện nay những mẫu tủ bếp đẹp đang được tủ bếp Hoàng Anh cung cấp trên thị trường và được khách hàng đón nhận. Và để đáp lại lòng tin đó, tủ bếp HOÀNG ANH đang cố gắng hơn nữa để thiết kế ra những mẫu tủ bếp đẹp, với những công năng sử dụng hợp lý để hỗ trợ tối đa cho người nội trợ.\r\nXin cảm ơn quý khách hàng đã quan tâm và coi sản phẩm của tủ bếp HOÀNG ANH như một phần tất yếu trong cuộc sống hàng ngày của gia đình bạn!', 'fe0c5b4eb2f05430ba0766d4c0a0eb5da1d9cc6b.jpg', '0000-00-00 00:00:00', '2016-03-12 07:54:31', null);
